import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: auto;
  background-color: #ffffff;
  box-shadow: 2px 3px 6px 0px rgb(0 0 0 / 40%);
`;

const MenuCard = ({ menu }) => {
  return (
    <Container>
      <img src={menu.img} alt="" />
    </Container>
  );
};

export default MenuCard;
